import './assets/FormularioRegistrarEquipo.css'
import axios from "../components/api/conexionApi";
import { useEffect, useState } from 'react';

const EquipoFormulario = () => {
  //para equipo
  const [equipoData, setEquipoData] = useState({
    nombreEquipo: '',
    descripcionEquipo: '',
    idEntrenador: '',
  });



  const handleEquipoChange = (e) => {
    const { name, value } = e.target;
    setEquipoData((prevData) => ({ ...prevData, [name]: value }));
  };

  const handleSubmitEquipo = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('/api/equipos', equipoData);
      console.log(response.data);
      // Aquí puedes manejar la respuesta según tus necesidades
    } catch (error) {
      console.error('Error al crear el equipo:', error.message);
      // Aquí puedes manejar el error según tus necesidades
    }
  };

  return (
    <form onSubmit={handleSubmitEquipo}>
      <label>
        Nombre del Equipo:
        <input
          type="text"
          name="nombreEquipo"
          value={equipoData.nombreEquipo}
          onChange={handleEquipoChange}
        />
      </label>
      <br />
      <label>
        Descripción del Equipo:
        <textarea
          name="descripcionEquipo"
          value={equipoData.descripcionEquipo}
          onChange={handleEquipoChange}
        />
      </label>
      <br />
      <label>
        ID del Entrenador:
        <input
          type="text"
          name="idEntrenador"
          value={equipoData.idEntrenador}
          onChange={handleEquipoChange}
        />
      </label>
      <br />
      <button type="submit">Crear Equipo</button>
    </form>
  );
};

const EntrenadorFormulario = () => {
  const [entrenadorData, setEntrenadorData] = useState({
    nombreEntrenador: '',
    apellidoEntrenador: '',
    correoEntrenador: '',
  });

  const handleEntrenadorChange = (e) => {
    const { name, value } = e.target;
    setEntrenadorData((prevData) => ({ ...prevData, [name]: value }));
  };

  const handleSubmitEntrenador = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('/api/entrenadores', entrenadorData);
      console.log(response.data);
      // Aquí puedes manejar la respuesta según tus necesidades
    } catch (error) {
      console.error('Error al crear el entrenador:', error.message);
      // Aquí puedes manejar el error según tus necesidades
    }
  };

  return (
    <form onSubmit={handleSubmitEntrenador}>
      <label>
        Nombre del Entrenador:
        <input
          type="text"
          name="nombreEntrenador"
          value={entrenadorData.nombreEntrenador}
          onChange={handleEntrenadorChange}
        />
      </label>
      <br />
      <label>
        Apellido del Entrenador:
        <input
          type="text"
          name="apellidoEntrenador"
          value={entrenadorData.apellidoEntrenador}
          onChange={handleEntrenadorChange}
        />
      </label>
      <br />
      <label>
        Correo del Entrenador:
        <input
          type="text"
          name="correoEntrenador"
          value={entrenadorData.correoEntrenador}
          onChange={handleEntrenadorChange}
        />
      </label>
      <br />
      <button type="submit">Crear Entrenador</button>
    </form>
  );
};

export default function App() {
  return (
    <div>
      <h1>Formulario de Equipo</h1>
      <EquipoFormulario />
      <h1>Formulario de Entrenador</h1>
      <EntrenadorFormulario />
    </div>
  );
}
